"118102":{"id":"118102","name":"Manhãs de Setembro","slug":"manhas-de-setembro","original_title":"Manhãs de Setembro","overview":"Cassandra deixa a própria cidade para trás, decidida a não fazer concessões para se tornar uma mulher trans livre e independente. Tudo muda quando Leide, uma ex-namorada, reaparece com um menino que diz ser filho de Cassandra.","first_air_date":"2021-06-25","episode_run_time":30,"vote_average":7.2,"number_of_seasons":2,"number_of_episodes":11,"created_by":[],"production_companies":["O2 Filmes"],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/9CSt3QFp3RaPMexGt2rSSV1KaAl.jpg","poster_path":"https://image.tmdb.org/t/p/original/tJ1XKPR4C3jTQKVgO9zu5ENtTla.jpg","cast":["Liniker","Gustavo Coelho","Seu Jorge","Karine Teles","Thomás Aquino"],"trailer":"NoXyFvRjem0","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/tJ1XKPR4C3jTQKVgO9zu5ENtTla.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/tJ1XKPR4C3jTQKVgO9zu5ENtTla.jpg","air_date":"2021-06-25","episode_count":5,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"É Só Por Hoje","overview":"Cassandra, mulher trans independente, trabalha como motogirl de um aplicativo de entregas e faz shows interpretando canções de Vanusa. Seu namoro com Ivaldo vai bem e ela conseguiu alugar uma quitinete.","air_date":"2021-06-25","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/oQwpdbfOHrwAKrYCEzYhhIc8z6S.jpg","vote_average":0},"2":{"name":"Para De Me Chamar De Pai!","overview":"Cassandra hospedou Leide e Gersinho por uma noite, mas Leide implora para ficar mais. Ela dá mais dois dias e segue rejeitando o menino que insiste em chamá-la de “pai”. E pior, Décio e Aristides chegam para conhecer o menino.","air_date":"2021-06-25","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/vqR0Tq6Km2kPnIrsaknXcpFnnlV.jpg","vote_average":0},"3":{"name":"Gersinho","overview":"Cassandra fica sozinha com Gersinho enquanto Leide procura emprego. Tenta se aproximar de Ivaldo que está chateado porque ela não contou que tinha um filho.","air_date":"2021-06-25","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/c3NjHfygpbtgXPTe6OEJUEBV60b.jpg","vote_average":0},"4":{"name":"É Pegar Ou Largar","overview":"Cassandra e Ivaldo fazem as pazes, mas se desentendem quando descobrem que estão juntos há um ano. Décio e Aristides acolhem Leide e Gersinho.","air_date":"2021-06-25","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/cAUlBT8AR2CHToxt8Air9Q2V4is.jpg","vote_average":0},"5":{"name":"É Isso Mesmo, Baby, Enjoy!","overview":"Cassandra tenta esquecer Ivaldo dando uma festa enquanto ele procura se reconectar com a família. Ari descobre que Leide roubou e a expulsa de casa. Gersinho fica na casa de uma amiga e Leide volta pra rua.","air_date":"2021-06-25","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/wkm5eGZWCM9jCAD6ngXKWyKVf6O.jpg","vote_average":0}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/ihrBYfGBPUVdI48ieRqe1hoYypN.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ihrBYfGBPUVdI48ieRqe1hoYypN.jpg","air_date":"2022-09-23","episode_count":6,"overview":"Cassandra se reúne com seu pai após uma década, e encontra um homem amoroso ansioso se reconectar com sua filha e sua nova família.","vote_average":0,"episodes":{"1":{"name":"Ah, vida em família... que preguiça","overview":"Voltando da prova de Gersinho, a Ipanema quebra e Cassandra se vê forçada a pedir ajuda a seu pai. Enquanto Gersinho e Leide ficam felizes em conhecer Lourenço, Cassandra fica mexida com o reencontro e a versão idealizada que ela tem de sua mãe começa a desmoronar.","air_date":"2022-09-23","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/vMM2OwTyJsrJFBaZyF5TeG3h8cW.jpg","vote_average":0},"2":{"name":"A baguncinha tradicional brasileira","overview":"Em São Paulo, Cassandra volta para sua família de afeto, retoma sua frenética rotina de trabalho e reencontra Ivaldo. Com Vanusa as coisas não andam bem e Cassandra começa a ter problemas com o repertório do show. Em Morretes, Leide e Gersinho têm uma convivência cheia de descobertas com o pai de Cassandra e sua nova esposa.","air_date":"2022-09-23","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/rZqxJqX4jDZu09uHGz7kInj1luK.jpg","vote_average":0},"3":{"name":"E hoje é dia de show","overview":"Leide e Gersinho voltam para São Paulo, mas o garoto não vai morar onde gostaria. Cassandra se compromete a levar e buscar Gersinho na escola todos os dias. Ivaldo leva sua filha Ivana a conhecer Cassandra no bar Metamorphosis.","air_date":"2022-09-23","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/eUgSXRA7Gap4FmDM9jusCE06Iv1.jpg","vote_average":0},"4":{"name":"De pé ou morta, de joelhos jamais","overview":"A moto quebra e Cassandra precisa encontrar outro meio de transporte para fazer as entregas. Para ajudar a amiga, Roberta propõe de Cassandra trabalhar de bargirl. Leide e Gersinho planejam o aniversário dele. Enquanto tenta vender seu carro, Leide recebe uma proposta inesperada. Para conseguir dinheiro, Cassandra precisa vender algo valioso.","air_date":"2022-09-23","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/jiZdM3uTWta1UCFbMbJ8DQbGP9Y.jpg","vote_average":0},"5":{"name":"Canta, canta...","overview":"Cassandra continua trabalhando de bargirl no Metamorphosis, mas os problemas financeiros continuam. Ela precisa encontrar uma saída e chama Gersinho para lhe ajudar. Já Leide nunca esteve tão bem. Décio faz o seu primeiro show solo.","air_date":"2022-09-23","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/h5jQbI0lt5zsEWeLqVlHXBoX3R0.jpg","vote_average":0},"6":{"name":"A vida não pode ser só isso","overview":"Com uma moto nova, Cassandra tenta recuperar o tempo e o dinheiro perdidos para conseguir chegar para a festa do filho. Gersinho usa o dinheiro do seu presente para comprar algo especial para Cassandra. Ela apresenta o filho para sua família escolhida. Pela primeira vez, Cassandra cogita ir atrás da mãe.","air_date":"2022-09-23","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/yr1tL5sFD3o9WbJogsMnTEv881x.jpg","vote_average":0}}}}},
