"99598":{"id":"99598","name":"Gatos Selvagens da Índia","slug":"gatos-selvagens-da-india","original_title":"Wild Cats of India","overview":"Os grandes felinos da Índia são símbolos de força e realeza desde a antiguidade, mas, apesar da reverência que evocam e de sua própria adaptabilidade e talento, esses felinos foram levados à grandes desafios. Com dois anos de produção, o \"Felinos Selvagens da Índia\" permitiu a viagem pelas paisagens contrastantes do país com a ambição de pintar um retrato íntimo da vida intrigante desses animais incríveis.","first_air_date":"2020-02-18","episode_run_time":45,"vote_average":7.3,"number_of_seasons":1,"number_of_episodes":2,"created_by":[],"production_companies":["Felis Creations"],"genres":["Documentário"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/5rAqaByuw1pzmu1j8Ho973CeSwS.jpg","poster_path":"https://image.tmdb.org/t/p/original/gOBmtcEV9AIB3zgM5ikzsHYB9ks.jpg","cast":["James Murray"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/gOBmtcEV9AIB3zgM5ikzsHYB9ks.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/gOBmtcEV9AIB3zgM5ikzsHYB9ks.jpg","air_date":"2020-02-18","episode_count":2,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A Proteção dos Ecossistemas","overview":"Veja o leopardo-das-neves proteger sua presa da raposa-vermelha e os últimos leões-asiáticos vivos.","air_date":"2020-02-18","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/uJbmBmypRYSdTri876oJu0EHe57.jpg","vote_average":0},"2":{"name":"Mestres em Disfarces","overview":"Assista a uma família de gatos-da-selva coexistir com uma família de raposas-de-bengala.","air_date":"2020-03-08","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/ay1Wm5umGGQq3XfE3wWSidI7L2s.jpg","vote_average":0}}}}},
