"92782":{"id":"92782","name":"Ms. Marvel","slug":"ms-marvel","original_title":"Ms. Marvel","overview":"Kamala Khan é uma adolescente muçulmana de Jersey City. Ela adora jogar videogames e escrever fanfictions, além de ser fã de super-heróis e ter uma imaginação sem limites – especialmente quando se trata da Capitã Marvel. Kamala sente que não se encaixa na escola e, às vezes, nem mesmo em casa. Mas um dia ela descobre que tem superpoderes como os heróis que sempre admirou... e a vida fica bem melhor com superpoderes, não é?","first_air_date":"2022-06-08","episode_run_time":0,"vote_average":6.4,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Bisha K. Ali"],"production_companies":["Marvel Studios","Kevin Feige Productions"],"genres":["Sci-Fi & Fantasy","Action & Adventure","Comédia"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/mfcLUWASJghU8MTNK38eYktfE83.jpg","poster_path":"https://image.tmdb.org/t/p/original/3HWWh92kZbD7odwJX7nKmXNZsYo.jpg","cast":["Iman Vellani","Matt Lintz","Zenobia Shroff","Yasmeen Fletcher","Mohan Kapur"],"trailer":"_euwFRjIYwU","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4qoFtoPvFGjlIXYfFVNKhOwZ6zD.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4qoFtoPvFGjlIXYfFVNKhOwZ6zD.jpg","air_date":"2022-06-08","episode_count":6,"overview":"N/A","vote_average":5.8,"episodes":{"1":{"name":"Geração Por quê?","overview":"Kamala Khan, uma adolescente de Jersey City que é fã dos Vingadores, se sente meio deslocada na escola e, às vezes, até em casa. Ela está determinada a ir a Vingacon, mesmo que os pais não permitam. Então, no que parecia ser uma competição de cosplay da Capitã Marvel, as coisas mudam subitamente. Será que ela está se tornando um dos super heróis que ela tanto admira?","air_date":"2022-06-08","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/gaBBBVXwSED1XNHe2wyQypp6ead.jpg","vote_average":6.403},"2":{"name":"O Crush","overview":"Enquanto investigam a origem dos poderes, Kamala e Bruno exploram as novas habilidades. Kamala, porém, se distrai do treino de heroína quando conhece Kamran, o garoto novo da escola. Mas ao se deparar com uma situação perigosa, seus poderes acabam sendo colocados à prova.","air_date":"2022-06-15","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/aemUtd7mjsVy1A0L4mMWZR1kKNA.jpg","vote_average":6},"3":{"name":"Destinada","overview":"Com o Departamento de Controle de Danos atrás dela, Kamala tenta se \"esconder\" no casamento de seu irmão. Quando ela conhece um grupo de pessoas que possui informações sobre mistérios que assolam sua família a gerações, Kamala aprende mais sobre a origem de seus poderes. Esses amigáveis desconhecidos precisam da ajuda de Kamala, mas qualquer decisão que ela tome pode ter graves consequências.","air_date":"2022-06-22","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/9xFmSh70LOfX7L7irdVyyJ2xRSp.jpg","vote_average":5.8},"4":{"name":"Visão Vermelha","overview":"Kamala viaja ao redor do mundo para resolver o mistério da pulseira e a história de sua família.","air_date":"2022-06-29","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/aRR3GD9S2yHeVG7CCV5M1DTWHJc.jpg","vote_average":5.5},"5":{"name":"O Tempo Dirá","overview":"O bracelete revela a Kamala segredos sobre sua linhagem familiar e a verdade por trás do véu.","air_date":"2022-07-06","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/zWYW7hExUaKCHYUzUGj7izGQVEW.jpg","vote_average":5.5},"6":{"name":"Nada Normal","overview":"De volta a Jersey, Kamala luta para salvar seus amigos das garras do Controle de Danos.","air_date":"2022-07-13","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/3cbOYF4iX2jEi5lTDQ5C0xAchPo.jpg","vote_average":5.8}}}}},
